import React from "react";

export default function Movie(props) {
  return (
    <div className="card">
      <div className="container">
        <img src={props.image} width="100%" height="350px" alt="john" />
        <h2>{props.name}</h2>
        <h4>
          {props.genre}-{props.year}
        </h4>
      </div>
    </div>
  );
}
